// FNV-1a hash function
static uint32_t fnv1a(const char *word, uint32_t seed) {
    uint32_t hash = 2166136261u ^ seed;
    for (int i = 0; i < 5; i++) {
        hash ^= (uint8_t)tolower(word[i]);
        hash *= 16777619u;
    }
    return hash;
}

void bloom_init(void) {
    memcpy(bloom_filter, bloom_data, BLOOM_SIZE_BYTES);
}

int bloom_check(const char *word) {
    for (int i = 0; i < 7; i++) {
        uint32_t hash = fnv1a(word, i * 0x9E3779B9);
        uint32_t bit = hash % 262144;
        if (!(bloom_filter[bit / 8] & (1 << (bit % 8)))) {
            return 0;
        }
    }
    return 1;
}

uint32_t encode_word(const char *word) {
    uint32_t result = 0;
    for (int i = 0; i < 5; i++) {
        result = (result << 5) | (tolower(word[i]) - 'a');
    }
    return result;
}

void decode_word(uint32_t encoded, char *out) {
    for (int i = 4; i >= 0; i--) {
        out[i] = 'a' + (encoded & 0x1F);
        encoded >>= 5;
    }
    out[5] = '\0';
}

void get_solution(int index, char *out) {
    if (index >= 0 && index < solution_count) {
        decode_word(solutions[index], out);
    }
}
